import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Header />
        <Routes>
          <Route path='/' element={<Banner />}/>
          <Route path='/signup' element={<Signup />}/>
          <Route path='/signin' element={<Signin />}/>
          <Route path='/services' element={<Services />}/>
          <Route path='/dashboard' element={<Dashboard />}/>
        </Routes>
        <Footer />
      </Router></>
  );
}

export default App;
